BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `weather` (
	`date`	TIMESTAMP,
	`item_id`	INTEGER,
	`store_id`	INTEGER,
	`station_id`	INTEGER,
	`temperature_min`	INTEGER,
	`temperature_max`	INTEGER,
	`temperature_avg`	INTEGER,
	`dewpoint`	INTEGER,
	`wetbulb_temperature`	INTEGER,
	`snowfall`	REAL,
	`preciptation_total`	REAL,
	`station_pressure`	REAL,
	`sealevel`	REAL,
	`avg_speed`	REAL,
	`humidity`	REAL,
	FOREIGN KEY(`date`) REFERENCES `date`(`surr_id`),
	FOREIGN KEY(`store_id`) REFERENCES `store`(`surr_id`),
	PRIMARY KEY(`date`,`station_id`,`item_id`,`store_id`),
	FOREIGN KEY(`item_id`) REFERENCES `item`(`surr_id`),
	FOREIGN KEY(`station_id`) REFERENCES `station`(`surr_id`)
);
CREATE TABLE IF NOT EXISTS `store` (
	`store_id`	INTEGER,
	`surr_id`	INTEGER,
	PRIMARY KEY(`surr_id`)
);
CREATE TABLE IF NOT EXISTS `station` (
	`station_id`	INTEGER,
	`surr_id`	INTEGER,
	PRIMARY KEY(`surr_id`)
);
CREATE TABLE IF NOT EXISTS `sales` (
	`date`	TIMESTAMP,
	`store_id`	INTEGER,
	`item_id`	INTEGER,
	`units_sold`	INTEGER,
	FOREIGN KEY(`item_id`) REFERENCES `item`(`surr_id`),
	FOREIGN KEY(`store_id`) REFERENCES `store`(`surr_id`),
	FOREIGN KEY(`date`) REFERENCES `date`(`surr_id`),
	PRIMARY KEY(`date`,`store_id`,`item_id`)
);
CREATE TABLE IF NOT EXISTS `item` (
	`item_id`	INTEGER,
	`surr_id`	INTEGER,
	PRIMARY KEY(`surr_id`)
);
CREATE TABLE IF NOT EXISTS `date` (
	`date`	TIMESTAMP,
	`surr_id`	INTEGER,
	PRIMARY KEY(`surr_id`)
);
COMMIT;
